Considerando a existência de torres instaladas em Delegacias e UOPs da SPRF-MS que eram usadas para o sistema de radio analógico, descontinuado, e que não estão sendo utilizados  no atual programa de rádio digital, pois não atendiam aos requisitos mínimos para este atual sistema de telecomunicação.

Considerando que, devido a constatação de longo período que estas torres em desuso ficaram sem manutenção, foram emitidos laudos técnicos por empresa especializada sobre a situação de cada estrutura ;

Considerando que a torre instalada na UOP de Terenos está condenada, conforme observado no Anexo I - Laudo da Torre da UOP Terenos, havendo uma iminência de ocorrer a queda da mesma;

Desta forma, faz-se necessária a contratação de Empresa especializada, de maneira emergencial, por questões de segurança, na desmontagem e descarte desta torre em epígrafe.
